import React from 'react';
import {
  MDBCard,
  MDBCardImage,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardFooter,
  MDBRow,
  MDBCol
} from 'mdb-react-ui-kit';
import defaultImage from '../../assets/default.jpeg';
import { API_URL } from '../Helper';

const Card = ({ data }) => {
  return (

        <MDBCard className='h-100'>
          <MDBCardImage
             src={data.img.path ? `${API_URL}/${data.img?.path}` : defaultImage}
            alt='...'
            position='top'
          />
          <MDBCardBody>
            <MDBCardTitle>{data.name}</MDBCardTitle>
            <MDBCardText>
             {data.description}
            </MDBCardText>
          </MDBCardBody>
          <MDBCardFooter>
            <small className='text-muted'>Last updated 3 mins ago</small>
          </MDBCardFooter>
        </MDBCard>

  );
}
export default Card
